import React, {Component} from 'react';


class Header extends Component{
  render(){
    return (
		<div>
			<header>
				<div className="logo">
					<img alt="logo" src="./images/terra-logo.png" />
				</div>
			</header>
		</div>
  );
  }
}

export default Header;
